import React from 'react';
import classNames from 'classnames';
import { SectionProps } from '../utils/SectionProps';
import GoogleLogin from 'react-google-login';
import Input from '../elements/Input';
// import ButtonGroup from '../components/elements/ButtonGroup';
// import Button from '../components/elements/Button';
// import Image from '../components/elements/Image';
// import Modal from '../components/elements/Modal';


const propTypes = {
    ...SectionProps.types
}
  
const defaultProps = {
    ...SectionProps.defaults
}

// const openModal = (e) => {
//     e.preventDefault();
//     setVideomodalactive(true);
// }

// const closeModal = (e) => {
//     e.preventDefault();
//     setVideomodalactive(false);
// }   
  
const Sigin = ({
        className,
        topOuterDivider,
        bottomOuterDivider,
        topDivider,
        bottomDivider,
        hasBgColor,
        invertColor,
        ...props
    }) => {

    const outerClasses = classNames(
        'hero section center-content',
        topOuterDivider && 'has-top-divider',
        bottomOuterDivider && 'has-bottom-divider',
        hasBgColor && 'has-bg-color',
        invertColor && 'invert-color',
        className
    );
    
    const innerClasses = classNames(
        'hero-inner section-inner',
        topDivider && 'has-top-divider',
        bottomDivider && 'has-bottom-divider'
    );

    const handleLogin = async googleData => {  
        const res = await fetch("/api/v1/auth/google", {
        method: "POST",
        body: JSON.stringify({
        token: googleData.tokenId
      }),
      headers: {
        "Content-Type": "application/json"
      }
    });
    const data = await res.json();
    console.log(data);
    // store returned user somehow
    return data;
  }

    return (
        <section
            {...props}
            className={outerClasses}>
            <div className="container-sm">
                <Input onKeyDown={_handleKeyDown} id="newsletter" type="email" label="Subscribe" labelHidden hasIcon="right" placeholder="Your email here">
                <svg onClick={subscribe} width="16" height="12" xmlns="http://www.w3.org/2000/svg">
                    <path d="M9 5H1c-.6 0-1 .4-1 1s.4 1 1 1h8v5l7-6-7-6v5z" fill="#376DF9" />
                </svg>
                </Input>
                Signin now and joint the community!
                <div className={innerClasses}>
                <GoogleLogin
                    clientId="159989980998-rifisq2hq3mn2lj2gf08tdjns6rtlvin.apps.googleusercontent.com"
                    buttonText="Log in with Google"
                    onSuccess={handleLogin}
                    onFailure={handleLogin}
                    cookiePolicy={'single_host_origin'}
                />
                </div>
            </div>
        </section>
    );
}
  
Sigin.propTypes = propTypes;
Sigin.defaultProps = defaultProps;
export default Sigin;
